import React, { useEffect } from 'react';
import './css/hotel.css';
import {RatedServices} from './ratedServices/ratedServices';

export const HotelComponent = ({state,openPopup,fetchHotels})=>{
    const {userReducer,hotels}=state; 
    const {email_verified,email}=userReducer;

    useEffect(()=>{
        fetchHotels();
    },[fetchHotels])

    return (
        <div className='hotels'>
                {hotels.map((hotel)=>{
                    return <div key={hotel.id} className='hotel'>
                            <p>{hotel.name}</p>
                            <RatedServices services={hotel.services} isLoggedIn={email_verified} user_email={email}/>

                        </div>   
                })}
        </div>
    );
}
